import { Button } from '@material-ui/core';
import './App.css';
// import 'bulma/css/bulma.css'
// import '../src/mystyles.scss'
// import image from '../src/image2vector.svg';
// import me from '../src/me.svg'; 
// import interview from '../src/interview.svg'
import ButtonAppBar from './navbar';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import { styled } from '@mui/material/styles';
// import Item from '@material-ui/core'
import me from '../src/me.svg'
const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  // padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

function App() {
  return (
    <div>
   <ButtonAppBar></ButtonAppBar>
   <Grid container spacing={1}>
  <Grid item xs={7}>
    <Item><img src={me} />
</Item>
  </Grid>
  <Grid item xs={5}>
    <Item>
      <h1 styles = "color: #Green; font-size:3em;">Ideas that build exceptional growth</h1>
      <h2>Thereâ€™s a smarter way to do business. A way that includes next-level services, a determined, relentless, and passionate consultant, and a unique perspective to help startups, founders, and visionaries get to the next level. </h2>
    </Item>
    </Grid>
    </Grid>
    </div>
  )
}

export default App;
